import React from 'react';
import { Parallax } from 'react-scroll-parallax';
import iPhone6 from '../../assets/iphone6gold.png';
import './ContentLeft.css';

const ContentLeft = () => {
    return(

            <div className="content-container">
                <div className="content1">
                    <p className="blue-heading">There's a better way to find a partner - do nothing</p>
                    <p className="black-parg">
                        With Kupenda you can forget about swiping, waiting, and all that extra baggage that comes with dating apps.
                        Using the power of the crowd, you are able to do sit back and let others do the matching for you. Match makers
                        will compare your profile with a perspective match, and match you accordingly based on your preferences. 
                        This cuts out the terribly inaccurate algorithms, and gets you the best quality matches you could ask for.
                    </p>
                    <p className="black-parg-2">
                    Swiping through crappy matches sucks. Kupenda solves this for you, by having others do the swiping for you,
                    as you reap the benefit of other peoples' good will.
                    </p>
                </div>
                <Parallax className="content2" y={[10, -10]} tagOuter="figure">
                    {/* <Image src="/image.jpg" /> */}
                    <img className="iphoneX" src={iPhone6} alt="phone"/>
                </Parallax>
            </div>
    )
}

export default ContentLeft
